-- 查看无效医生
SELECT id, name, hospitalId, departmentId FROM doctors WHERE name = '无效医生' OR name = '' OR name IS NULL LIMIT 10;

-- 查看重复科室
SELECT name, COUNT(*) as count FROM departments GROUP BY name HAVING count > 1 LIMIT 10;

